function Nav() {
  return (
    <nav>
      <ul id='navul'>
        <div id="brand">
          <img src='logo192.png' alt='react' />React
        </div>
        <li className="navlist" aria-current="page">home</li>
        <li className="navlist">about</li>
        <li className="navlist">contact</li>
        <li className="navlist">more</li>
